import React from 'react';
import { NavigationContainer } from '@react-navigation/native';
import NavegacaoPrincipal from './app/navigation/NavegacaoPrincipal';

export default function App() {
  return (
    <NavigationContainer>
      <NavegacaoPrincipal />
    </NavigationContainer>
  );
}
